import React from 'react';
import Main from './Main'
import './App.css';

function App() {
  return (
    <div className="App">
     <div>
        <header className="App-header">
            <h1>
                Random Quote Display.
            </h1>
        </header>
    </div>
      <Main />
    </div>
  );
}

export default App;
